/**
 * 作者：Mr.wang
 * 时间：2022/4/11
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */
import React, {Component} from "react";

export default class ListArea extends Component {

    render() {
        const {showData} = this.props;
        return (
            <div>
                <ul>
                    {showData.map(item => {
                        console.log(item)
                        return (
                            <li key={item.id}>
                                <input type="checkbox" aria-checked={item.done}/>
                                <span>{item.name}</span>
                            </li>
                        )
                    })}
                </ul>
            </div>
        );
    }
}
